import React from 'react';
import Card from './CharacterCard';

const TeamList = (props) => {

  let cards = props.students.map(studentObj => <Card key={studentObj._id} student={studentObj} handleToggle={props.handleToggle} />)

  return (
    <div>
    <h1>My Wizarding Team</h1>
    <div id="team-list">
      {cards}
    </div>
    </div>
  )
}

export default TeamList;
